/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react'
import { HistoryModel } from 'app/modules/history/models/Account'
import HistoryItem from './components/HistoryItem'
type Props = {
  className: string,
  histories?: HistoryModel[]
}

const HistoryList: React.FC<Props> = ({ className, histories }) => {
  return (
    <div className={`card ${className}`}>
      {/* begin::Header */}
      <div className='card-header border-0 pt-5'>
        <h3 className='card-title align-items-start flex-column'>
          <span className='card-label fw-bolder fs-3 mb-1'>Danh sách đang chạy</span>
          <span className='text-muted mt-1 fw-bold fs-7'>Có {histories?histories.length:0} users</span>
        </h3>
      </div>
      {/* end::Header */}
      {/* begin::Body */}
      <div className='card-body py-3'>
        {/* begin::Table container */}
        <div className='table-responsive'>
          {/* begin::Table */}
          <table className='table table-row-dashed table-row-gray-300 align-middle gs-0 gy-4'>
            {/* begin::Table head */}
            <thead>
              <tr>
                <th className='min-w-30px'>#</th>
                <th className='min-w-100px'>Thời gian</th>
                <th className='min-w-140px'>Info</th>
                <th className='min-w-140px'>Nguồn chạy</th>
                <th className='min-w-120px'>Video/Proxy</th>
                <th className='min-w-100px'>Trạng thái</th>
              </tr>
            </thead>
            {/* end::Table head */}
            {/* begin::Table body */}
            <tbody>
              {
                histories&&histories?.map((item: HistoryModel,index:number) => {
                  return <HistoryItem key={item.id} item={item} index={index}/>
                })
              }

            </tbody>
            {/* end::Table body */}
          </table>
          {/* end::Table */}
        </div>
        {/* end::Table container */}
      </div>
      {/* begin::Body */}
    </div>
  )
}

export { HistoryList }
